import React from 'react';
import './App.css';
import { Routes, Route, Link } from "react-router-dom";
import UserHome from './Components/Home/UserHome/UserHome';
import UserHeader from './Components/Header/UserHeader/UserHeader';


function App() {
  return (

    <div className="App">

    <Routes>
      <Route path="/" element={<UserHome />} />
      <Route path="/header" element={<UserHeader />} />
    </Routes>

    </div>

  );
}

export default App;
